import React from "react";
import { Container, Row, Col, Card, CardHeader, CardBody, CardImg } from "shards-react";

class Iniative extends React.Component{
  render() {
    return(
        <Container>

      <Row style="10px;">
        <Col>
          <Card> 
            <CardHeader><h3>Card header</h3></CardHeader>
            <CardImg top src="https://cdn.pixabay.com/photo/2015/07/17/22/43/student-849825_960_720.jpg" />
            <CardBody>
              <p>This is the body of the card.</p>
            </CardBody>
          </Card>
        </Col>
      </Row>
    </Container>

    )
  }
}

export default Iniative;
